export async function queryString(){return new Promise((function(e){const t=location.search.replace("?","").split("&");let n={};if(t.length>0)for(let e=0;e<t.length;e++)if(t[e].search("=")>=0){const o=t[e].split("="),c=o[0],i=o[1];""!==i&&(n[c]=decodeURIComponent(i))}0===Object.keys(n).length&&(n=void 0),e(n)}))}